import logo from './logo.svg';
import React from 'react';
import ReactDom from 'react-dom';
import {BrowserRouter} from "react-router-dom";
import './App.css';

function Header(){
  return(
    <h1> Hello world</h1>
  )
}

function App() {
  return (

    <div className="App">
      <BrowserRouter>
        <Header/>
       </BrowserRouter>

    </div>
  );
}

export default App;
